import * as React from "react";
import { Layout, Menu } from "antd";

// eslint-disable-next-line @typescript-eslint/no-var-requires
const styles = require("./default.less");
const { Header, Content } = Layout;

const DefaultLayout: React.FunctionComponent = ({ children }) => (
  <div>
    <Layout>
      <Header>
        <div className={styles.logo} />
        <Menu
          id="menu"
          theme="dark"
          mode="horizontal"
          defaultSelectedKeys={["2"]}
        >
          <Menu.Item key="1">ほげ</Menu.Item>
          <Menu.Item key="2">ふが</Menu.Item>
          <Menu.Item key="3">なんとかかんとか</Menu.Item>
        </Menu>
      </Header>
      <Content className={styles.content_wrapper}>
        <div className="content">{children}</div>
      </Content>
    </Layout>
  </div>
);

export default DefaultLayout;
